import * as actions from "../actions";

const Dashboard = () => {
  return (
    <div>
      Dashboard !!!
      <div className="fixed-action-btn">
        <a className="btn-floating btn-large red">
          <i className="material-icons">add</i>
        </a>
      </div>
    </div>
  );
};

export default Dashboard;
